import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styled from 'styled-components';

const PageContainer = styled.div`
 background-color: #4c4c4c;
 min-height: 101vh;
`;

const LoadingText = styled.div`
 margin-top: 20px;
 font-size: 20px;
 color: white;
`;

const StockItem = styled.div`
 margin-bottom: 20px;
`;

const StockHeader = styled.div`
 display: flex;
 justify-content: space-between;
 align-items: center;
`;

const StockInfo = styled.div`
 display: flex;
 flex-direction: column;
`;

const CompanyName = styled.div`
 font-size: 20px;
 color: white;
`;

const TickerText = styled.div`
 font-size: 14px;
 color: lightgray;
`;

const PriceText = styled.div`
 font-size: 16px;
 color: white;
`;

const ChangePercentText = styled.div`
 font-size: 14px;
 color: lightgray;
`;

const DetailsText = styled.div`
 font-size: 14px;
 color: white;
`;

const TabContainer = styled.div`
 display: flex;
 justify-content: space-around;
 margin-top: 20px;
`;

const TabButton = styled.button`
 background-color: #333;
 color: white;
 border: none;
 padding: 10px 20px;
 cursor: pointer;
 &:hover {
   background-color: #555;
 }
`;

export const SOTD = () => {
 const [data, setData] = useState(null);
 const [contentLoaded, setContentLoaded] = useState(false);
 const [activeTab, setActiveTab] = useState('Day Trading');

 useEffect(() => {
   axios
     .get('http://localhost:5001/api/filtered_stocks')
     .then((response) => {
       console.log('Fetched Data:', response.data);
       setData(response.data);
       setContentLoaded(true);
     })
     .catch((error) => {
       console.log('ERROR:', error);
     });
 }, []);

 console.log('State Data:', data);

 return (
   <PageContainer>
     {!contentLoaded ? (
       <LoadingText>Loading...</LoadingText>
     ) : (
       <div>
         <TabContainer>
           <TabButton onClick={() => setActiveTab('Day Trading')}>Day Trading</TabButton>
           <TabButton onClick={() => setActiveTab('Swing Trading')}>Swing Trading</TabButton>
           <TabButton onClick={() => setActiveTab('Long Term')}>Long Term</TabButton>
         </TabContainer>
         {activeTab === 'Day Trading' && (
           <div>
             <h2>Day-trading</h2>
             <h3>Top picks for today</h3>
             <ul>
               {data && data['Day Trading']?.map((stock, index) => (
                 <StockItem key={index}>
                   <StockHeader>
                     <CompanyName>{index + 1}. {stock.name}</CompanyName>
                     <StockInfo>
                       <PriceText>${stock.price ? stock.price.toFixed(2) : 'N/A'}</PriceText>
                       <ChangePercentText>{stock.change_percent ? stock.change_percent.toFixed(2) : 'N/A'}%</ChangePercentText>
                     </StockInfo>
                   </StockHeader>
                   <TickerText>{stock.ticker}</TickerText>
                   <DetailsText>Volume: {stock.volume ? stock.volume.toLocaleString() : 'N/A'}</DetailsText>
                   <DetailsText>Market Cap: {stock.market_cap ? stock.market_cap.toLocaleString() : 'N/A'}</DetailsText>
                   <DetailsText>P/E Ratio: {stock.pe_ratio ? stock.pe_ratio.toFixed(2) : 'N/A'}</DetailsText>
                   <DetailsText>Entry Point: ${stock.entry_point ? stock.entry_point.toFixed(2) : 'N/A'}</DetailsText>
                   <DetailsText>Exit Point: ${stock.exit_point ? stock.exit_point.toFixed(2) : 'N/A'}</DetailsText>
                   <DetailsText>Analysis: {stock.analysis}</DetailsText>
                 </StockItem>
               ))}
             </ul>
           </div>
         )}
         {activeTab === 'Swing Trading' && (
           <div>
             <h2>Swing Trading</h2>
             <h3>Top picks for today</h3>
             <ul>
               {data && data['Swing Trading']?.map((stock, index) => (
                 <StockItem key={index}>
                   <StockHeader>
                     <CompanyName>{index + 1}. {stock.name}</CompanyName>
                     <StockInfo>
                       <PriceText>${stock.price ? stock.price.toFixed(2) : 'N/A'}</PriceText>
                       <ChangePercentText>{stock.change_percent ? stock.change_percent.toFixed(2) : 'N/A'}%</ChangePercentText>
                     </StockInfo>
                   </StockHeader>
                   <TickerText>{stock.ticker}</TickerText>
                   <DetailsText>Volume: {stock.volume ? stock.volume.toLocaleString() : 'N/A'}</DetailsText>
                   <DetailsText>Market Cap: {stock.market_cap ? stock.market_cap.toLocaleString() : 'N/A'}</DetailsText>
                   <DetailsText>P/E Ratio: {stock.pe_ratio ? stock.pe_ratio.toFixed(2) : 'N/A'}</DetailsText>
                   <DetailsText>Entry Point: ${stock.entry_point ? stock.entry_point.toFixed(2) : 'N/A'}</DetailsText>
                   <DetailsText>Exit Point: ${stock.exit_point ? stock.exit_point.toFixed(2) : 'N/A'}</DetailsText>
                   <DetailsText>Analysis: {stock.analysis}</DetailsText>
                 </StockItem>
               ))}
             </ul>
           </div>
         )}
         {activeTab === 'Long Term' && (
           <div>
             <h2>Long Term</h2>
             <h3>Top picks for today</h3>
             <ul>
               {data && data['Long Term']?.map((stock, index) => (
                 <StockItem key={index}>
                   <StockHeader>
                     <CompanyName>{index + 1}. {stock.name}</CompanyName>
                     <StockInfo>
                       <PriceText>${stock.price ? stock.price.toFixed(2) : 'N/A'}</PriceText>
                       <ChangePercentText>{stock.change_percent ? stock.change_percent.toFixed(2) : 'N/A'}%</ChangePercentText>
                     </StockInfo>
                   </StockHeader>
                   <TickerText>{stock.ticker}</TickerText>
                   <DetailsText>Volume: {stock.volume ? stock.volume.toLocaleString() : 'N/A'}</DetailsText>
                   <DetailsText>Market Cap: {stock.market_cap ? stock.market_cap.toLocaleString() : 'N/A'}</DetailsText>
                   <DetailsText>P/E Ratio: {stock.pe_ratio ? stock.pe_ratio.toFixed(2) : 'N/A'}</DetailsText>
                   <DetailsText>Entry Point: ${stock.entry_point ? stock.entry_point.toFixed(2) : 'N/A'}</DetailsText>
                   <DetailsText>Exit Point: ${stock.exit_point ? stock.exit_point.toFixed(2) : 'N/A'}</DetailsText>
                   <DetailsText>Analysis: {stock.analysis}</DetailsText>
                 </StockItem>
               ))}
             </ul>
           </div>
         )}
       </div>
     )}
   </PageContainer>
 );
};
